    true,nt"url": null,nt"notes": "<p>All of the data used on the Finder.HealthCare.gov
    web application is available through this API. There are multiple collections of
    data available through the API.<br />n1.  Public Options Data - This data set includes
    Medicaid, CHIP, High Risk and Territory data along with all of the other public
    options available. The appropriate options are returned based on the criteria submitted
    in the API call.<br />n2.  Individual and Family Health Insurance Options Data -
    Paginated individual and family health insurance plan data, a subset of the full
    plan data including pricing, is returned for plans that match the criteria submitted
    in the API call for available plans. Full plan data is returned when a specific
    plan is requested with all appropriate criteria.<br />n3.  Small Group Insurance
    Options Data - Paginated Small Group health insurance product data, a subset of
    the full product data including pricing, is returned for products that match the
    criteria submitted in the API call for available products. Full product data is
    returned when a specific product is requested with all appropriate criteria.</p>n",nt"license_title":
